// Dependencies.
import React from 'react';

// Component 'AboutMe'.
function AboutMe() {
    return (
        // AboutMe Container.
        <>
            <div id="AboutMe">
                <div id="JumboAbout" class="jumbotron jumbotron-fluid">
                    <div class="container">
                        <div class="row">
                            <div class="col-sm">
                            <span className="display-4 ml-4">Shawn Luther</span>
                                <img id="iamshawn-profile2" className="img-thumbnail" alt="iamshawn2.jpg" src="../../assets/misc/iamshawn2.jpg" />
                               
                            </div>
                        </div>
                        <div class="row">
                            <div class="col-sm">
                                <h1 className="display-4">Shawn Luther</h1>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    );
}

// Do export.
export default AboutMe;
